import Terms from '../src/app/views/components/terms';

import detectBrowserLanguage from 'detect-browser-language'

async function getIP(){
  let data = await fetch('http://ip-api.com/json')
    .then(res => {
      // console.log(res.json());
      return res.json()
    })    
  return data
}

